import React, { Component } from "react";
import Search from "./components/Search";
import "./App.css";

export default class App extends Component {
  render() {
    return (
      <div className="container">
        <Search />
        <div className="row">
          <div className="card">
            <a href="http://github.com/reactjs" target="_blank">
              <img
                src="http://avatars.githubusercontent.com/u/6412038?v=3"
                style={{ width: "100px" }}
              />
            </a>
            <p className="card-text">reactjs</p>
          </div>
          <div className="card">
            <a href="http://github.com/angular" target="_blank">
              <img
                src="http://avatars.githubusercontent.com/u/1399197?v=3"
                style={{ width: "100px" }}
              />
            </a>
            <p className="card-text">angular</p>
          </div>
          <div className="card">
            <a href="http://github.com/angular" target="_blank">
              <img
                src="http://avatars.githubusercontent.com/u/1399197?v=3"
                style={{ width: "100px" }}
              />
            </a>
            <p className="card-text">angular</p>
          </div>
        </div>
      </div>
    );
  }
}
